!function(){tinymce.PluginManager.add("citation",function(t,i){t.addButton("citation_key",{icon:"citation-icon",tooltip:"Insert Citation",onclick:function(){t.windowManager.open({title:"Insert Citation",body:[{type:"textbox",name:"cite_text",label:"Citation Text"}],width:500,height:80,onsubmit:function(i){t.insertContent("[citepro]"+i.data.cite_text+"[/citepro]")}})}})})}()
